import { faSearch } from '@fortawesome/free-solid-svg-icons'
import './App.css';

function App() {
  return (
    <div className="app d-flex justify-content-center align-items-center">
      <div className="card text-white bg-dark" style={{ width: "500px" }}>
        <div className="card-header">
          <form className="">
            <div className="input-group-prepend">
                <div className="input-group-text"><input type="search" className="form-controlm-" id="inlineFormInputGroup" /><FontAwesomeIcon icon={faSearch}/></div>
              </div>
          </form>
            </div>
          <div className="card-body">


          </div>
        </div>
      </div>
  );
}

export default App;
